TabAbout::TabAbout (MasterAndCommander *m)
    : master (m),
      groupComponent (0),
      label (0),
      textEditor (0),
      cachedImage_aes_cb_jpg (0)
{
    addAndMakeVisible (groupComponent = new GroupComponent (T("new group"),
                                                            T("Background Information and Credits")));

    addAndMakeVisible (label = new Label (T("new label"),
                                          T("FIG2: Me at the \"Social Event\" of the 35th Int. AES conference (\"Audio for Games\"). Please note how extraordinary good the colors of the various image components match the color theme of this plugin!\n")));
    label->setFont (Font (15.0000f, Font::italic));
    label->setJustificationType (Justification::topLeft);
    label->setEditable (false, false, false);
    label->setColour (TextEditor::textColourId, Colours::black);
    label->setColour (TextEditor::backgroundColourId, Colour (0x0));

    addAndMakeVisible (textEditor = new TextEditor (T("new text editor")));
    textEditor->setMultiLine (true);
    textEditor->setReturnKeyStartsNewLine (true);
    textEditor->setReadOnly (true);
    textEditor->setScrollbarsShown (true);
    textEditor->setCaretVisible (true);
    textEditor->setPopupMenuEnabled (true);
    textEditor->setText (T("\n  About Me and HybridReverb2:\n\n  As a research associate at the Institute of Communication\n  Acoustics, Ruhr-Universit\xe4t Bochum, Germany, I\'m currently\n  persuing a Dr.-Ing. degree in electrical engineering.\n  I benefited from free and open source software for so many\n  years that I felt that I should give something back to the\n  community. As I\'m working in the field of virtual acoustics\n  and spatial audio, writing a room effect plugin kind of\n  suggested itself. I hope you enjoy the sound as much as I\n  do!\n\n  Best regards,\n  Christian Bor\xdf <christian.borss@rub.de>\n\n\n  Credits:\n\n  - Julian Storer for his JUCE library\n  - The development team of the Jucetice project (jost, juced,\n    etc.)\n  - Matteo Frigo, Steven G. Johnson, and anybody else who\n    contributed to the FFTW library\n  - Prof. Rainer Martin for supporting my research\n  - Bj\xf6rn Kapteina for the implementation of the Windows\n    installer\n\n\n  References:\n\n  Bor\xdf, C., Martin, R. (2009). \"An Improved Parametric Model\n  for Perception-Based Design of Virtual Acoustics\", AES 35th\n  Int. Conference, London, UK, Feb. 2009.\n\n  Bor\xdf, C. (2009). \"A Novel Approach for Optimally Matching a\n  Late Reverberation Model to an Image Source Model - Or:\n  What Does a Football Have to Do With Shoebox Shaped\n  Rooms?\", Auralization Symposium of the European Acoustics\n  Association, Espoo, Finland, Jun. 2009.\n\n  Bor\xdf, C. (2009). \"A VST Reverberation Effect Plugin Based on\n  Synthetic Room Impulse Responses\", 12th Int. Conference\n  on Digital Audio Effects (DAFx-09), Como, Italy, Sep. 2009.\n"));

    cachedImage_aes_cb_jpg = ImageCache::getFromMemory (aes_cb_jpg, aes_cb_jpgSize);

    //[UserPreSize]
    //[/UserPreSize]

    setSize (828, 548);

    //[Constructor] You can add your own custom stuff here..
//    master->print("TabAbout::TabAbout : Waiting for your commands, Sir!");
    master->registerTabAbout(this);
    //[/Constructor]
}

TabAbout::~TabAbout()
{
    //[Destructor_pre]. You can add your own custom destruction code here..
    //[/Destructor_pre]

    deleteAndZero (groupComponent);
    deleteAndZero (label);
    deleteAndZero (textEditor);
    ImageCache::release (cachedImage_aes_cb_jpg);

    //[Destructor]. You can add your own custom destruction code here..
    //[/Destructor]
}

//==============================================================================
void TabAbout::paint (Graphics& g)
{
    //[UserPrePaint] Add your own custom painting code here..
    //[/UserPrePaint]

    g.fillAll (Colour (0xffffe000));

    g.setColour (Colours::white);
    g.fillRect (462, 14, 348, 422);

    g.setColour (Colours::grey);
    g.drawRect (462, 14, 348, 422, 1);

    g.setColour (Colours::black);
    g.drawImageWithin (cachedImage_aes_cb_jpg,
                       464, 16, 345, 419,
                       RectanglePlacement::centred | RectanglePlacement::onlyReduceInSize,
                       false);

    //[UserPaint] Add your own custom painting code here..
    //[/UserPaint]
}

void TabAbout::resized()
{
    groupComponent->setBounds (8, 8, 440, 500);
    label->setBounds (464, 444, 344, 64);
    textEditor->setBounds (24, 32, 408, 464);
    //[UserResized] Add your own custom resize handling here..
    //[/UserResized]
}



